export const ROOT_IS_AUTHENTICATED = 'ROOT_IS_AUTHENTICATED';
export const ROOT_HAS_SEEN_STEP1 = 'ROOT_HAS_SEEN_STEP1';
export const ROOT_HAS_SEEN_STEP2 = 'ROOT_HAS_SEEN_STEP2';
export const ROOT_HAS_SEEN_STEP3 = 'ROOT_HAS_SEEN_STEP3';
export const ROOT_HAS_VOTED = 'ROOT_HAS_VOTED';
export const ROOT_HAS_COMPLETED_XP = 'ROOT_HAS_COMPLETED_XP';

type isAuthentifcated = {
  type: typeof ROOT_IS_AUTHENTICATED;
};

type hasSeenStep1 = {
  type: typeof ROOT_HAS_SEEN_STEP1;
};
type hasSeenStep2 = {
  type: typeof ROOT_HAS_SEEN_STEP2;
};
type hasSeenStep3 = {
  type: typeof ROOT_HAS_SEEN_STEP3;
};
type hasVoted = {
  type: typeof ROOT_HAS_VOTED;
};
type hasCompletedXp = {
  type: typeof ROOT_HAS_COMPLETED_XP;
};

export type RootActionTypes = isAuthentifcated | hasSeenStep1 | hasSeenStep2 | hasSeenStep3 | hasVoted | hasCompletedXp;

export interface RootState {
  hasValidateAuthentification: boolean;
  seenStep1: boolean;
  seenStep2: boolean;
  seenStep3: boolean;
  hasVoted: boolean;
  completedXp: boolean;
}
